import React, { Fragment } from "react";
import "../styles/login";

const Login = () => (
  <Fragment>
    <form>
      <input type="text" name="email" placeholder="Seu email" />
      <input type="password" name="password" placeholder="Senha secreta" />

      <input type="submit"> Entrar </input>
    </form>
  </Fragment>
);

export default Login;
